// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

contract depositAndRefund{

    uint balance; 

    event Deposited(address indexed payee, uint256 weiAmount);
    event Withdrawn(address indexed payee, uint256 weiAmount);

    mapping(address => uint) balanceMapping;


    function getBalance(address _party) public returns(uint){
        balance = address(_party).balance;
        return balance;
    }



    function deposit(uint amountInEth) public payable{

        emit Deposited(msg.sender, msg.value * 100000000000000000);

        require(balanceMapping[msg.sender] >= amountInEth);
        balanceMapping[msg.sender] += amountInEth * 100000000000000000;
    }

    // modifier onlyOwner(){
    //     require(msg.sender == owner);
    //     _;
    // }



}

